import React from 'react';
import {Container, AppBar,Typography, Grow,Grid} from '@material-ui/core';

import YouChat from './images/YouChat.png';
const App = () => {
  return (
    <Container maxWidth="lg">
      <AppBar position="static" color="inherit">
        <Typography variant="h2" align="center">YouChat</Typography>
        <img src={YouChat} alt="YouChat" height="500" />
      </AppBar>
      </Container>
  );
}

export default App;
